import React from 'react'
import Manifest from './manifest.json'

const Section = (data) => {
    var i = data.data
    return (
    <div className='flex flex-col ring-1 ring-gray-200 p-4 bg-white rounded-md relative'>
        <div className='font-bold text-base leading-snug pr-5 my-3'>{i.heading}</div>
        <div className='absolute right-0 top-0 p-2'>
            <div className={ !open ? 'ml-auto text-gray-400 self-start transform rotate-0 duration-300 ease-in-out' : "ml-auto text-gray-500 self-start bg-gray-100 rounded-full transform rotate-180 duration-300 ease-in-out"}><ModalSVG /></div>
        </div>
    </div>
    )
}

const Tokenomics = () => { 
    return (
    <div className='grid md:grid-flow-col text-white p-7 md:gap-x-10 bg-black'>
        <div className='grid grid-flow-row mb-7'>
            <div className='font-extrabold text-sm opacity-50 mb-9'>{Manifest.heading}</div>
        </div>
        <div className='bg-white bg-opacity-10 rounded-xl p-5'>
            {Manifest.content.map((i, key) => {
                return <Section key={key} data={i}/>;
                })}
        </div>
    </div>
    )
}

export default Tokenomics
